import React, {Component} from 'react';
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    useParams,
    useRouteMatch
} from "react-router-dom";

class TestPri extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            items: []
        }

    }
    componentDidMount(){
        const res = fetch("http://127.0.0.1:8000/prizivniki/")
        .then (res => res.json())
        .then(

            (result) =>{
                this.setState({
                    isLoaded:true,
                    items: result,
                });
            },
            (error) =>{
            this.setState({
                isLoaded:false,
                error});
            }
        )
        // console.log(res)
    }
    render() {
        const {error, isLoaded, items} = this.state;
        if (error) {
            return <p>ERROR</p>
        } else if (!isLoaded) {
            return <p>LOADING</p>
        } else {
            return (
                <div>

                    <div className={"assortment"}>Ассортимент</div>
                    <div className={"range_list"}>

                        {items.map(item=>(
                            <div className={"priziv"} key={"surname:"+item.surname}>
                                <Link to={`/prizivniki/${item.surname}/`}>{item.adress}</Link>
                            </div>
                        ))}
                    </div>
                </div>


            );
        }
    }
}

export default TestPri;
